import React from "react";
import { Nav, NavbarContainer, NavLogo } from "./NavbarElements";

// Note: write rafce to quickly create the import react and arrow function template.

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo to>dolla</NavLogo>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
